```
const span = document.querySelector('span');
span.addEventListener('mouseover', () => span.style.color ='red');
```

When the ```mouseover``` event is fired, the code inside the event handler executes. The ```style``` object can be used to set CSS properties, so in this example, we are setting the color to ```red``` when the mouse is over the element.

